import styled from 'styled-components';

function Home() {
  return (
    <Main className='flex-full'>
      <Container>
        <h1> Ultra</h1>
        <MainInfo>
          <h2> Photography</h2>
          <p> iam a professional <span> Photographer </span>  who take impressive view and images , let us work together
              ,thank you
          </p>
          <button> Let's Begin</button>
        </MainInfo>
      </Container>
    </Main>
  )
}

const Main = styled.main`
  justify-content: center;
  text-align: center;
  margin-top: 70px;
  background-image: url(/images/home-bg.jpg);
  background-size: cover;
  background-position: center;
  height: 80vh;
`
const Container = styled.div`
  h1{
    margin-bottom: 40px
  }
`
const MainInfo = styled.div`
  h2{
    color: orange;
  }

  p{
    margin: 20px 0;
    color: rgb( 100 , 100 , 100);
  }

  p span{

  }
`

export default Home
